---CREATE DATABASE ContactPlus --
USE ContactPlus;
GO

-- Tabla: Clientes:
CREATE TABLE Clientes (
    ID_Cliente INT NOT NULL PRIMARY KEY,
    Nombre VARCHAR(150) NOT NULL,
    Direccion VARCHAR(150),
    Telefono VARCHAR (15),
    Ciudad VARCHAR(150)
);


-- Tabla: Departamentos
CREATE TABLE Departamentos (
    ID_DPTO INT NOT NULL PRIMARY KEY,
    Descripcion VARCHAR(150) NOT NULL,
);

-- Tabla: Agentes
CREATE TABLE Agentes (
    ID_Agentes INT NOT NULL PRIMARY KEY,
    Nombre VARCHAR(150) NOT NULL,
    Cargo VARCHAR(150) NOT NULL,
    Habilidades VARCHAR(150),
    Horario_Trabajo VARCHAR(50),
    ID_DPTO INT NOT NULL,
    FOREIGN KEY (ID_DPTO) REFERENCES Departamentos(ID_DPTO)
);



-- Tabla: Llamadas
CREATE TABLE Llamadas (
    ID_Llamada INT NOT NULL PRIMARY KEY,
    Fecha_Hora DATETIME NOT NULL,
    Duracion TIME NOT NULL,
    Resultado VARCHAR(200) NOT NULL,
    ID_Agente INT NOT NULL,
    ID_Cliente INT NOT NULL,
    FOREIGN KEY (ID_Agente) REFERENCES Agentes(ID_Agentes),
    FOREIGN KEY (ID_Cliente) REFERENCES Clientes(ID_Cliente)
);




-- Tabla: KPI
CREATE TABLE KPI (
    ID_KPI INT NOT NULL PRIMARY KEY,
    Tiempo_Medio_Espera VARCHAR(150),
    Tiempo_Conversacion VARCHAR(150),
    Tasa_Abandonos_gENERAL VARCHAR(150),
    Satisfaccion_Clientes DECIMAL(10, 2),
    ID_Llamadas INT NOT NULL,
    FOREIGN KEY (ID_Llamadas) REFERENCES Llamadas(ID_Llamada)
);



-- Tabla: Interacciones
CREATE TABLE Interacciones (
    ID_Interacciones INT NOT NULL PRIMARY KEY,
    Consulta VARCHAR(150),
    Problema VARCHAR(150),
    Solicitud VARCHAR(150),
    Prioridad_Consulta VARCHAR(150),
    ID_Llamadas INT NOT NULL,
    FOREIGN KEY (ID_Llamadas) REFERENCES Llamadas(ID_Llamada)
);



-- Tabla: Servicios
CREATE TABLE Servicios (
    ID_Servicio INT NOT NULL PRIMARY KEY,
    Descripcion VARCHAR(150) NOT NULL
);


-- Tabla: Facturacion
CREATE TABLE Facturacion (
    ID_Facturacion INT NOT NULL PRIMARY KEY,
    Fecha_Facturacion DATE NOT NULL,
    Valor_Factura DECIMAL(10, 2),
    Observacion VARCHAR(150),
    ID_Servicio INT NOT NULL,
    ID_Cliente INT NOT NULL,
    FOREIGN KEY (ID_Servicio) REFERENCES Servicios(ID_Servicio),
    FOREIGN KEY (ID_Cliente) REFERENCES Clientes(ID_Cliente)
);
